pragma solidity 0.5.16;

contract Market {
    address[16] public itens;

    function comprar(uint256 nftId) public returns (uint256) {
        require(nftId >= 0 && nftId <= 15);

        itens[nftId] = msg.sender;

        return nftId;
    }

    function getItens() public view returns (address[16] memory) {
  return itens;
}
}
